import React from 'react';
import styled from 'styled-components';

const HeaderWrap = styled.div`
display: flex;
justify-content: space-between;
background-color: #202327;

`;

function Header() {
  return (
    <HeaderWrap>
      <ul>
        <li>Home</li>
        <li>Selection</li>
        <li>Login</li>
      </ul>
    </HeaderWrap>
  );
}

export default Header;
